import React from 'react';
import './App.css';

class App extends React.Component {

  constructor() {
    super();
    this.state = {
      inputValue: ''
    }
  }
  render() {
    let {inputValue} = this.state;
    return (
      <div className="App">
        <header className="App-header">
          <input type = "text" value ={inputValue}></input>

        </header>
      </div>
    );
  }  
}

export default App;
